import React from "react";
import "../Styling/Day.scss";
const day = (props) => {
  const { dayData } = props;
  const { dayText, value, onDaySelect } = dayData;
  return (
    <div className="day">
      <div>{dayText}</div>
      <div
        className={`circle ${value ? "active" : ""}`}
        onClick={onDaySelect}
      ></div>
    </div>
  );
};

export default day;
